(156, 2, '2017-07-27 00:28:59', '2017-07-26 22:28:59', 'Anyone who reads Old and Middle English literary texts will be familiar with the mid-brown volumes of the EETS, with the symbol of Alfred''s jewel embossed on the front cover. Most of the works attributed to King Alfred or to Aelfric, along with some of those by bishop Wulfstan and much anonymous prose and verse from the pre-Conquest period, are to be found within the Society''s three series; all of the surviving medieval drama, most of the Middle English romances, much religious and secular prose and verse including the English works of John Gower, Thomas Hoccleve and most of Caxton''s prints all find their place in the publications. Without EETS editions, study of medieval English texts would hardly be possible.', 'New User', '', 'publish', 'open', 'open', '', 'new-user', '', '', '2017-07-29 13:40:33', '2017-07-29 11:40:33', '', 0, 'http://localhost/demo/?p=156', 0, 'post', '', 3),
